  constructor() {
    this.head = null;
    this.tail = null;
  }

  enqueue(value) {
    const newNode = new LinkedList(value);

    if (!this.tail) {
      this.tail = newNode;
      this.head = newNode;
      return;
    }

    this.tail.next = newNode;
    this.tail = this.tail.next;
  }

  dequeue() {
    const result = this.head;
    if (this.head === this.tail) {
