    if (visited.has(current)) continue;
    visited.add(current);
    if (current === target) return currVal;

    const links = adjList[current];
    for (let i = 0; i < links.length; i++) {
      const [neighbor, value] = links[i];
      links.setColor(i, "green");
      stack.push([neighbor, currVal * value]);
      links.setColor(i, null);
    }
  }

  return -1;
}

