var shortestPathAllKeys = function (grid) {
  const m = grid.length;
  const n = grid[0].length;

  function* getAdjacentCells(row, col) {
    for (const [dRow, dCol] of DIRECTIONS) {
      const [nRow, nCol] = [row + dRow, col + dCol];
      if (nRow < 0 || nRow >= m || nCol < 0 || nCol >= n) continue;

      yield [nRow, nCol];
    }
  }

  let keysCount = 0;
  const queue = new Queue();

  const isKey = (cell) => cell >= "a" && cell <= "f";
  const isLock = (cell) => cell >= "A" && cell <= "F";

  for (let i = 0; i < m; i++) {
    for (let j = 0; j < n; j++) {
      const cell = grid[i][j];
      if (isKey(cell)) {
        keysCount++;
      } else if (cell === START) {
        // [row, col, keyState]
        queue.enqueue([i, j, 0]);
      }
    }
  }

  const keyOffset = "a".charCodeAt(0);
  const keyBitmask = 1 << keysCount;
  const visited = grid.map((row) => window.Array.from(row, () => new Array(keyBitmask)));

  let steps = -1;
