    steps++;
    const size = queue.size();

    for (let i = 0; i < size; i++) {
      const [row, col, keys] = queue.dequeue();

      if (keys === keyBitmask - 1) return steps;

      for (const [nRow, nCol] of getAdjacentCells(row, col)) {
        if (visited[nRow][nCol][keys]) continue;
        visited[nRow][nCol][keys] = 1;

        const cell = grid[nRow][nCol];
        if (cell === WALL) continue;

        let newKeys = keys;

