var isValidSudoku = function (board) {
  const size = 9;

  const getBoxIndex = (row, col) => {
    const boxRow = Math.floor(row / 3);
    const boxCol = Math.floor(col / 3);
    return (boxRow * 3) + boxCol; 
  };

  const rows = new Array(9);
  const cols = new Array(9);
  const boxes = new Array(9);

  const checkState = (arr, index, bit) => {
    const state = (arr[index] ??= 0);
    if (state & bit) return false;
    arr[index] += bit;
    return true;
  };

  for (let i = 0; i < size; i++) {
    for (let j = 0; j < size; j++) {
      board[i].setColor(j, "cyan");
      const val = board[i][j];
      if (val === ".") continue;

      const valBit = 1 << val;
      if (
        !checkState(rows, i, valBit) ||
        !checkState(cols, j, valBit) ||
        !checkState(boxes, getBoxIndex(i, j), valBit)
      )
        return false;
    }
  }

  return true;
};

return isValidSudoku;

