    nums.setColor(right, "cyan");
    nums.setColor(middle, "green");
    nums.setColor(left, null);
    nums.setColor(right, null);

    const validPairs = findWithDiff(middle);

    if (validPairs < p) {
      left = middle + 1;
    } else {
      right = middle;
    }
  }

  return left;
};

