var search = function (nums, target) {
  const n = nums.length;
  if (n === 0) return false;

  let left = 0;
  let right = n - 1;

  while (left <= right) {
    const middle = left + ((right - left) >> 1);
    nums.setColor(left, "cyan");
    nums.setColor(right, "cyan");
    nums.setColor(middle, "green");
    nums.setColor(middle, null);

    if (nums[middle] === target) return true;

    if (nums[left] === nums[middle]) {
      // BS is not helpful, can't determine where the number is.
      // Going forward!
      left++;
      continue;
    }

    const isPivotInLeft = nums[left] < nums[middle];
    const isTargetInLeft = nums[left] <= target;

    if (isPivotInLeft !== isTargetInLeft) {
      if (isPivotInLeft) {
        left = middle + 1; // pivot is in left, target is in right
      } else {
        right = middle - 1;
      }
    } else {
      // pivot and target are in the same subarray
      if (nums[middle] < target) {
        left = middle + 1;
      } else {
        right = middle - 1;
      }
    }
  }

  return false;
};

