    [nums[right], nums[storedIndex]] = [nums[storedIndex], nums[right]];
    return storedIndex;
  };

  let left = 0;
  let right = nums.length - 1;

  while (true) {
    const pivotIndex = left + Math.floor(Math.random() * (right - left + 1));
    const newPivotIndex = partition(left, right, pivotIndex);
