/**
 * @param {number[][]} mat
 * @return {number[][]}
 */
var updateMatrix = function (mat) {
  const m = mat.length;
  const n = mat[0].length;

  const matrixName = "dp";

  const dp = Array.from(
    mat,
    (row, index) =>
      Array.from(row, (val) => val, null, {
        index,
        parentName: matrixName,
      }),
    null,
    { matrixName }
  );

  for (let row = 0; row < m; row++) {
    for (let col = 0; col < n; col++) {
      if (dp[row][col] === 0) continue;

      let minNeighbor = Infinity;
      if (row > 0) {
        minNeighbor = Math.min(minNeighbor, dp[row - 1][col]);
      }

      if (col > 0) {
        minNeighbor = Math.min(minNeighbor, dp[row][col - 1]);
      }

      dp[row][col] = minNeighbor + 1;
    }
  }

  for (let row = m - 1; row >= 0; row--) {
    for (let col = n - 1; col >= 0; col--) {
      if (dp[row][col] === 0) continue;

      let minNeighbor = Infinity;
      if (row < m - 1) {
        minNeighbor = Math.min(minNeighbor, dp[row + 1][col]);
      }

      if (col < n - 1) {
        minNeighbor = Math.min(minNeighbor, dp[row][col + 1]);
      }

      dp[row][col] = Math.min(dp[row][col], minNeighbor + 1);
    }
  }

  return dp;
};

return updateMatrix;

